import React, { useState } from 'react'
import Counter from './components/counter';
import ClassCounter from './components/classCounter';
import Posts from './components/posts';
import './styles/App.css'

function App() {

  const [value, setValue] = useState('Какой-то текст')
  const [posts] = useState([
    { id: 1, title: 'Java Script', body: 'язык прогuwhqhuqраммирования' },
    { id: 2, title: 'cf', body: 'fidjijd' },
    { id: 3, title: 'gyggu', body: 'язык' },
    { id: 4, title: 'ggggijgyytrte', body: 'hghhghgheowdl,eokrdewt' },
    { id: 5, title: 'fnirunefi', body: 'яjoefr,ekekkmx vowj' }
  ])

  return (
    <div className="App">
      <h1>{value}</h1>
      <input type='text' value={value} onChange={event => setValue(event.target.value)}></input>
      <Counter></Counter>
      <ClassCounter></ClassCounter>
      {posts.map(post =>
        <Posts post={post}></Posts>
      )}

    </div>
  );
}

export default App;
